webpackJsonp([0x91e337b2ffa3],{332:function(e,A){e.exports={data:{markdownRemark:{html:'<h1>Project Jupyter</h1>\n<p>From Spring 2017 to Fall 2017, I worked as an intern with <a href="https://jupyter.org/">Project Jupyter</a>, an open source platform for interactive computing. Project Jupyter\'s most popular project is the Jupyter Notebook, which is pictured below. It runs in the browser, and it is intended primarily for students, data scientists, scientists, and engineers.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.82514734774067%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="JupyterLab Preview"\n        title=""\n        src="/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-a408b.png"\n        srcset="/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-4eabf.png 148w,\n/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-5a375.png 295w,\n/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-a408b.png 590w,\n/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-9a0cc.png 885w,\n/static/jupyterpreview-8142c319731bb17fd94bceeeb30ba9e8-f9428.png 1018w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nThe Jupyter Notebook\n</p>\n<p>This project gave me a lot of experience with web development. Specifically, I learned about the depths of Typescript, React, HTML, CSS, Webpack and Electron.</p>\n<h2>JupyterLab Native</h2>\n<p>JupyterLab Native was my primary project over the summer of 2017. Project Jupyter is currently developing their next generation environment, <a href="https://github.com/jupyterlab/jupyterlab">JupyterLab</a>. I worked on developing the native version of this app using <a href="https://electron.atom.io/">electron</a>. You can find the github page for the project <a href="https://github.com/jupyterlab/jupyterlab_app">here</a>. </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="JupyterLab Native"\n        title=""\n        src="/static/jupyternative-d7303cc22af489b651777d721a5cc715-adfc8.png"\n        srcset="/static/jupyternative-d7303cc22af489b651777d721a5cc715-b4fb9.png 148w,\n/static/jupyternative-d7303cc22af489b651777d721a5cc715-ab48e.png 295w,\n/static/jupyternative-d7303cc22af489b651777d721a5cc715-adfc8.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nThe JupyterLab Native Logo\n</p>\n<p>The native version of JupyterLab takes advantage of native API\'s to augment to JupyterLab experience. There were several challenges to overcome in this project. JupyterLab\'s webpack build was very complex and difficult to port. Furthermore, mapping JupyterLab\'s API\'s to native API\'s was often nontrivial.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="JupyterLab Native"\n        title=""\n        src="/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-ca545.jpg"\n        srcset="/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-aa1b7.jpg 148w,\n/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-b937a.jpg 295w,\n/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-ca545.jpg 590w,\n/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-75639.jpg 885w,\n/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-8bd51.jpg 1180w,\n/static/jupyterdev-88228d16f622b1656df9a7d241623ab1-b6456.jpg 1224w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nWorking with designers on JupyterLab Native\n</p>\n<p>I also worked closely with the Jupyter designers to improve the JupyterLab Native experience. Above is a picture from one of many design brainstorms.</p>',frontmatter:{title:"Project Jupyter"}}},pathContext:{slug:"/projects/jupyter/"}}}});
